import React from 'react';
import './App.css';
import { HashRouter, Route, Routes } from 'react-router-dom';
import About from './routes/About';

function App(){
	return (
		<HashRouter>
			<Routes>
				<Route path="/about" element={<About />}></Route> 버전의 변화		
			</Routes>
		</HashRouter>
	);
}

export default App;
